  <style>
    :root{--text:#0f172a}
    body{margin:0;font-family:'Noto Kufi Arabic',ui-sans-serif,system-ui,-apple-system,Segoe UI,Roboto,Arial,sans-serif;line-height:1.7;color:var(--text);background:#fff}
    .page-header{position:sticky; top:0; z-index:60; background:linear-gradient(90deg,rgba(137,194,51,.7),rgba(162,215,90,.7)); backdrop-filter:saturate(140%) blur(8px); color:#111; border-bottom:1px solid rgba(0,0,0,.06); box-shadow:0 4px 10px rgba(0,0,0,.18);}
    .page-header .inner{width:min(1100px,96%); margin-inline:auto; display:flex; flex-direction:row; align-items:center; justify-content:space-between; gap:14px; padding:.7rem .8rem;}
    .brand-icon{width:48px;height:48px;flex:0 0 auto;background:#fff;border-radius:50%;padding:6px;box-sizing:content-box;filter:drop-shadow(0 2px 6px rgba(0,0,0,.15))}
    .brand-title{font-weight:900; letter-spacing:.4px; font-size:1.4rem; color:#111}
    .brand-slogan{font-size:.95rem;color:#000;font-weight:700}
    .nav-links{display:flex; gap:14px; align-items:center}
    .nav-links a{color:#111; text-decoration:none; padding:.35rem .6rem; border-radius:10px; border:1px solid transparent; font-weight:700}
    .nav-links a:hover{background:rgba(255,255,255,.14); border-color:rgba(0,0,0,.25); color:#000}
    .nav-links a.cta{background:#fff;color:#0f172a;font-weight:800; padding:.45rem 1rem;border-radius:12px;box-shadow:0 4px 10px rgba(0,0,0,.15); border:1px solid rgba(0,0,0,.12);}
    .nav-links a.cta:hover{background:#f3f4f6;color:#000;border-color:rgba(0,0,0,.2)}

    main{width:min(1100px,96%); margin:24px auto}
    .section{background:transparent; border:1px dashed rgba(0,0,0,.12); border-radius:14px; padding:16px}
  .nav-links a{color:#111; text-decoration:none; padding:.35rem .6rem; border-radius:10px; border:1px solid transparent; font-weight:700}
.nav-links .active{background:rgba(255,255,255,.22);border-color:rgba(255,255,255,.35); color:#ffffff}
  
  /* Header shrink effect */
  .page-header.shrink .inner{padding:.55rem .8rem}
  .page-header .inner{width:min(1100px,96%); margin-inline:auto; display:flex; flex-direction:row; align-items:center; justify-content:space-between; gap:14px; padding:.7rem .8rem;}

  /* Slider fade edges */
  .slider-wrap{position:relative;overflow:hidden}
  .slider-wrap::before,
  .slider-wrap::after{
    content:""; position:absolute; top:0; bottom:0; width:40px; z-index:5;
    pointer-events:none;
  }
  .slider-wrap::before{left:0; background:linear-gradient(90deg,#fff,transparent)}
  .slider-wrap::after{right:0; background:linear-gradient(270deg,#fff,transparent)}
  body.dark .slider-wrap::before{background:linear-gradient(90deg,#111827,transparent)}
  body.dark .slider-wrap::after{background:linear-gradient(270deg,#111827,transparent)}

  .brand-group{display:flex;align-items:center;gap:10px}
  .brand-text{display:flex;flex-direction:column}
  .page-header.shrink{box-shadow:0 6px 14px rgba(0,0,0,.22)}

   @media (max-width: 768px) {
     .page-header .inner {
       padding: .55rem .8rem;
       gap: 10px;
       flex-wrap: wrap;
     }
     .brand-icon { width: 40px; height: 40px; }
     .brand-title { font-size: 1.15rem; }

     .nav-links {
       width: 100%;
       order: 3;
       display: flex;
       gap: 8px;
       overflow-x: auto;
       -webkit-overflow-scrolling: touch;
       padding-bottom: 4px;
     }
     .nav-links a { padding: .35rem .55rem; font-size: .9rem; white-space: nowrap; }

     main { width: min(100%, 96%); margin: 14px auto; }
     .section { padding: 12px; }

     .hero-logo {
       top: 76px;
       left: 50%;
       transform: translateX(-50%);
       width: 120px;
       opacity: .18;
     }

     .slider-wrap::before, .slider-wrap::after { width: 24px; }
   }

   @media (max-width: 480px) {
     .brand-title { font-size: 1rem; letter-spacing: .2px; }
     .brand-slogan { display: none; }
     .nav-links a.cta { padding: .4rem .7rem; border-radius: 10px; }
     .section { padding: 10px; }
   }
